/**
 * PropertyCard.jsx
 * 
 * Componente de card individual de imóvel.
 * Exibe informações resumidas de um imóvel na listagem.
 * 
 * Props recebidas:
 * - property: Objeto com dados do imóvel
 * 
 * Funcionalidades:
 * - Exibe imagem principal
 * - Mostra título, localização e descrição resumida
 * - Exibe características (quartos, banheiros, área)
 * - Mostra preço destacado
 * - Link para página de detalhes
 */

import React from 'react';
// Ícones para características do imóvel
import { MapPin, Bed, Bath, Maximize } from 'lucide-react';
import { Link } from 'react-router-dom';

/**
 * Componente PropertyCard
 * 
 * Recebe property via props (destructuring direto no parâmetro)
 * É um componente "apresentacional" - apenas exibe dados, sem lógica complexa
 */
const PropertyCard = ({ property }) => {
  return (
    // Card principal - container do imóvel
    <div style={styles.card}>

      {/* Container da imagem */}
      <div style={styles.imageContainer}>
        {/* 
          Imagem principal do imóvel
          - property.images[0]: Primeira imagem do array
          - alt: Texto alternativo para acessibilidade
        */}
        <img 
          src={property.images[0]} 
          alt={property.title}
          style={styles.image}
        />

        {/* Badge com tipo do imóvel (Apartamento, Casa, etc) */}
        <div style={styles.badge}>{property.type}</div>
      </div>

      {/* Conteúdo textual do card */}
      <div style={styles.content}>

        {/* Título do anúncio */}
        <h3 style={styles.title}>{property.title}
          {property.description.substring(0, 100)}...
        </h3>

        {/* Localização com ícone */}
        <div style={styles.location}>
          <MapPin size={16} />
          <span>{property.location}</span>
        </div>

        {/* 
          Descrição resumida
          - substring(0, 100): Pega apenas 100 primeiros caracteres
          - ...reticências indicam que há mais texto
        */}
        <p style={styles.description}>
          {property.description.substring(0, 100)}...
        </p>

        {/* Container de características (quartos, banheiros, área) */}
        <div style={styles.features}>

          {/* Quartos */}
          <div style={styles.feature}>
            <Bed size={18} />
            <span>{property.bedrooms} quartos</span>
          </div>

          {/* Banheiros */}
          <div style={styles.feature}>
            <Bath size={18} />
            <span>{property.bathrooms} banheiros</span>
          </div>

          {/* Área em m² */}
          <div style={styles.feature}>
            <Maximize size={18} />
            <span>{property.area}m²</span>
          </div>
        </div>

        {/* Footer do card - preço e botão */}
        <div style={styles.footer}>

          {/* 
            Preço formatado
            - toLocaleString('pt-BR'): Formata número no padrão brasileiro (2.500)
          */}
          <div style={styles.price}>
            Valor {property.price.toLocaleString('pt-BR')}/mês
          </div>

          {/* 
            Link para detalhes
            - Template literal para URL dinâmica: /imovel/1, /imovel/2, etc
          */}
          <Link to={`/imovel/${property.id}`} style={styles.button}>
            Ver Detalhes
          </Link>
        </div>
      </div>
    </div>
  );
};

/**
 * Estilos do componente
 * Organizados por seção do card
 */
const styles = {
  // Card principal - container externo
  card: {
    backgroundColor: 'white',
    borderRadius: '8px',         // Bordas arredondadas
    overflow: 'hidden',          // Esconde conteúdo que ultrapassa bordas
    boxShadow: '0 2px 8px rgba(0,0,0,0.1)',  // Sombra para profundidade
    transition: 'transform 0.3s, box-shadow 0.3s',  // Animação suave
    cursor: 'pointer'            // Indica que é clicável
  },

  // Container da imagem (posicionamento relativo para badge absoluto)
  imageContainer: {
    position: 'relative',        // Permite posicionamento absoluto dos filhos
    height: '200px',             // Altura fixa
    overflow: 'hidden'           // Corta imagem se maior que container
  },

  // Imagem do imóvel
  image: {
    width: '100%',               // Largura total do container
    height: '100%',              // Altura total do container
    objectFit: 'cover'           // Cobre área sem distorcer (crop)
  },

  // Badge com tipo do imóvel (posicionado sobre a imagem)
  badge: {
    position: 'absolute',        // Posicionamento absoluto em relação ao pai
    top: '1rem',                 // 16px do topo
    right: '1rem',               // 16px da direita
    backgroundColor: '#2563eb',
    color: 'white',
    padding: '0.25rem 0.75rem',
    borderRadius: '4px',
    fontSize: '0.875rem',        // 14px
    fontWeight: 'bold'
  },

  // Container do conteúdo textual
  content: {
    padding: '1.5rem'            // Espaçamento interno
  },

  // Título do imóvel
  title: {
    margin: '0 0 0.5rem 0',      // Apenas margin bottom
    fontSize: '1.25rem',         // 20px
    color: '#1f2937'             // Cinza escuro
  },

  // Container da localização
  location: {
    display: 'flex',
    alignItems: 'center',
    gap: '0.5rem',               // Espaço entre ícone e texto
    color: '#6b7280',            // Cinza médio
    fontSize: '0.875rem',
    marginBottom: '1rem'
  },

  // Descrição do imóvel
  description: {
    color: '#4b5563',
    fontSize: '0.875rem',
    lineHeight: '1.5',           // Espaçamento entre linhas
    marginBottom: '1rem'
  },

  // Container das características (flexbox)
  features: {
    display: 'flex',
    gap: '1rem',                 // Espaço entre items
    marginBottom: '1rem',
    paddingBottom: '1rem',
    borderBottom: '1px solid #e5e7eb'  // Linha separadora
  },

  // Item individual de característica
  feature: {
    display: 'flex',
    alignItems: 'center',
    gap: '0.25rem',
    color: '#6b7280',
    fontSize: '0.875rem'
  },

  // Footer do card (preço + botão)
  footer: {
    display: 'flex',
    justifyContent: 'space-between',  // Preço à esquerda, botão à direita
    alignItems: 'center'
  },

  // Preço destacado
  price: {
    fontSize: '1.5rem',          // 24px - grande e destacado
    fontWeight: 'bold',
    color: '#2563eb'             // Azul primário
  },

  // Botão de ver detalhes
  button: {
    backgroundColor: '#2563eb',
    color: 'white',
    padding: '0.5rem 1rem',
    borderRadius: '4px',
    textDecoration: 'none',      // Remove sublinhado do link
    fontSize: '0.875rem',
    fontWeight: '500',
    transition: 'background-color 0.3s'  // Transição suave no hover
  }
};

export default PropertyCard;
